import React, { useContext, useEffect } from 'react'
import styled from 'styled-components'
import { Link } from 'react-router-dom'
import AuthContext from '../context/AuthProvider'
import { withRouter } from 'react-router-dom'

const Navbar = ({ history }) => {
  const { logInUser, setLogInUser } = useContext(AuthContext)

  useEffect(() => {
    // setLogInUser({ id: 1, name: 'temp' })
    // console.log(logInUser)
  }, [])

  const logOut = (e) => {
    e.preventDefault()
    localStorage.removeItem('logedInUser')
    history.push('/login')
  }

  return (
    <NavContainer>
      <div className='nav-header'>
        <div className='home'>
          <Link to='/'>
            <button>Home</button>
          </Link>
        </div>
        <div>
          {localStorage.getItem('logedInUser') == undefined ? (
            <>
              <div>
                <Link to='/login'>
                  <button className='login'>Login</button>
                </Link>
                <Link to='/register'>
                  <button className='register'>Register</button>
                </Link>
              </div>
            </>
          ) : (
            <>
              <div>
                <Link to='/profile'>
                  <button className='new-note'>Profile</button>
                </Link>
                <Link to='/dashboard'>
                  <button className='new-note'>All Notes</button>
                </Link>
                <Link to='/'>
                  <button className='new-note'>My Notes</button>
                </Link>
                <Link to='/new-note'>
                  <button className='new-note'>New Note</button>
                </Link>
                <Link to='/'>
                  <button className='logout' onClick={logOut}>
                    Logout
                  </button>
                </Link>
              </div>
            </>
          )}
        </div>
      </div>
    </NavContainer>
  )
}

const NavContainer = styled.nav`
  height: 4rem;
  max-width: 900px;
  align-items: center;
  justify-content: center;
  margin: 10px auto 60px;

  .remove {
    display: none;
  }

  .new-note {
    margin-right: 10px;
  }

  .nav-header {
    display: flex;
    align-items: center;
    justify-content: space-between;
    background: #e4e9f0;
  }
  .login {
    margin-right: 10px;
  }

  button {
    /* display: block; */
    margin: 20px auto;
    width: 80px;
    height: 30px;
    border-radius: 10px;
    border: none;
    /* color: #eee; */
    background: #0096ff;
    color: white;
    font-size: 15px;
    box-shadow: 1px 4px 10px 1px #aaa;
  }

  button:hover {
    background: black;
    color: white;
  }
`

export default withRouter(Navbar)
